Le elezioni presidenziali in Venezuela del 2013 si sono svolte il 14 aprile. I candidati principali erano il presidente in carica ad interim Nicolás Maduro del Partito Socialista Unito del Venezuela e Henrique Capriles Radonski del partito Prima la Giustizia. La vittoria elettorale è andata a Maduro che ha ottenuto il 50,66% dei voti contro il 49,07% di Radonski. Le elezioni si sono tenute dopo appena sei mesi dalle ultime, per via della morte del presidente Hugo Chávez. Il risultato è stato fortemente contestato a causa di presunti brogli, e il 16 aprile dei forti scontri hanno portato alla morte di sette persone.
Oltre ai due principali, gli altri candidati erano:

Reina Sequera, sindacalista ed ex candidata presidenziale del Partito per il potere dei lavoratori;
María Bolívar, avvocato e proprietaria della panetteria "Mayami" nello stato di Zulia e candidato per il Partito Democratico Unito per la Pace e la Libertà (PDUPL);
Eusebio Méndez, pastore cristiano e candidato di Nuova Visione per il Mio Paese (NUVIPA);
Julio Mora, candidato del Partito di Unità Democratica (UDEMO).

L’université technique de Munich (en allemand : Technische Universität München, TUM) est une université allemande, fondée en 1868 et localisée à Munich. Elle forme actuellement environ 38 000 étudiants avec 501 professeurs. Elle fait partie depuis 2006 des 9 universités allemandes dites « universités d'élite ». Cette appellation amorcée par le plan « initiative d'excellence » signifie que la TU Munich disposera de moyens supplémentaires dans le domaine de la recherche en particulier.
L'université a de nombreux accords de coopérations internationales favorisant les échanges d'étudiants, les doubles diplômes et les projets de recherche :

Top Industrial Managers for Europe (TIME) ;
Liens vers l'Asie organisés en tutorats et stages d'échange (LAOTSE) ;
Université franco-allemande ;
IMCC-USA.Elle compte notamment environ 20 % d'étudiants étrangers soit environ 7 600 étudiants en 2014.
Elle fait partie du consortium d'universités qui délivre le master européen Mamaself dans le cadre du programme Erasmus Mundus.

Master Sciences des matériaux avec l'université de Rennes I, l'université Louis-et-Maximilien de Munich, l'université de Turin.

L'iléus paralytique est une hypomotricité intestinale d'origine fonctionnelle. Il peut aller jusqu'à un arrêt total du transit.
Ce traumatisme peut être :

mécanique, comme dans la plaie par impact ;
chimique, comme dans la perforation d'ulcère digestif ;
infectieux, comme dans la péritonite ;
inflammatoire, comme dans la pancréatite ;
métabolique, comme dans l'hypokaliémie ;
médicamenteux, comme les opiacés.Des vomissements et un arrêt des matières et des gaz sont survenus, avec parfois une haleine fécaloïde.

La rivière Saint-Jean Nord-Ouest (anglais : Saint-John River North-West Branch) est un cours d’eau traversant la région administrative de la Chaudière-Appalaches, au Sud du Québec, au Canada et le Nord du Maine, aux États-Unis. Son cours coule dans:

la municipalité régionale de comté (MRC) de Montmagny: municipalité de Lac-Frontière;
le Comté d'Aroostook (canton T11 R17 WELS), dans l'État du Maine;
le Comté de Somerset (Maine) (canton T10 R17 WELS), dans l'État du Maine.Du côté canadien, la route 204 longe la frontière sur 6,4 km et traverse la rivière Saint-Jean Nord-Ouest, du côté Sud-Est du lac Frontière.
Du côté américain, une route partant de Lac-Frontière se dirige vers l’Est en passant dans les montagnes. En sus, une route de la rive Nord du segment de rivière en aval de la confluence de la rivière Daaquam dessert le canton T11 R17 WELS du North Maine Woods.
